// ==UserScript==
// @name         Persistant Teams Notif
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  Notification Teams
// @author       Benyamin Limanto
// @match        *://teams.microsoft.com/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=teams.microsoft.com
// @license      MIT
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/491397/Persistant%20Teams%20Notif.user.js
// @updateURL https://update.greasyfork.org/scripts/491397/Persistant%20Teams%20Notif.meta.js
// ==/UserScript==

(function() {
    'use strict';
    function setNotificationCallback() {

        const OldNotify = window.Notification;
        const audio = new Audio("data:audio/wav;base64,");
        audio.volume = 0.05;
        const newNotify = class Notification {
            constructor(title, opt){
                audio.play();
                console.log(title); console.log(opt);
                opt.requireInteraction = true;
                opt.silent = false;
                opt.badge = "";
                opt.data = null
                opt.dir = "auto";
                opt.scenario = "default";
                opt.tag = Math.floor(Math.random()*100000);
                opt.renotify = false;
                opt.onclick = function(x) {
                    x.preventDefault();
                    window.open("https://teams.microsoft.com/_?clientType=pwa#/activity");
                    setTimeout(() => {window.focus()}, 500);
                    console.log(x);
                };

                if (opt.duplicate != true)
                {
                    setTimeout(() => {
                        opt.duplicate = true;
                        new newNotify(title, opt);
                    },2000);
                }

                return new OldNotify(title, opt);
            }
        };
        newNotify.requestPermission = OldNotify.requestPermission.bind(OldNotify);
        Object.defineProperty(newNotify, 'permission', {
            get: () => {
                return OldNotify.permission;
            }
        });

        window.Notification = newNotify;
    }
    setNotificationCallback();
})();